import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      title: "Bryan Ge | Portfolio",
      headerLinks: [
        { title: 'Home', path: '/'},
        { title: 'About', path: '/'},
        { title: 'Resume'}
      ]
    }
  }
  render() {
    return (
      <div>Hello from React!</div>
    );
  }
}

export default App;
